	hcst[y]=ycst[(y+1)]-ycst[y];

}



for(n=0;n<(ddx*ddy);n++){

	spxy[n]=1+(4*Math.random());

}













function fxy(td, tmax, x,y,sp){

	t=3.5*td;

	res=new Array();

	hx=width/2;

	hy=height/2;

	rc=(hy-y)/(hx-x);

		if(x<hx){

		xx=x-(t*sp);

		yy=y-(t*rc*sp);

		}

		else{

		xx=x+(t*sp);

		yy=y+(t*rc*sp);

		}

		



	res[0]=xx;

	res[1]=yy;

	return res;

		

	

}



