var ssx="Anyone who claims that something is not allowed should absolutely not disturb those who are working on it . Some people dream of great things while others stay awake and realize them . Either I find a way or I make a way . Mistakes are opportunities to learn . If you don't pull it anymore you have to push . Those who want to do something find a means for those who want to do something an excuse . The person who undertakes something and fails there is still better than the one who does nothing and succeeds . You have to make the memory you want later . When you let go of everything you have two hands free to grasp the future . If there are two roads take the quick will on the easy one it is usually crowded . It is impossible to say pride . It is risky experience said . It is pointless said the mind . Give it a chance whispered the heart . Do what you always did and you will get what you always got . It is no shame to move forward slowly  but it is to remain standing still . You can also have a beautiful view halfway up the mountain . It is not the falling that is bad  but staying where you fell . A branch that does not bend with the wind will break . Give me the power to change what I can change  the tolerance to accept what I cannot change  and the wisdom to distinguish between the two . When you hesitate  your fear grows when you dare  your courage grows . What cannot be done has never happened . One candle can light other candles without shortening its own life . You have not lost if you give up but if you have never tried . Better to light a candle than to curse the darkness . You never know what you can do until you try . You cannot move forward with both feet on the ground . Going against the current is the only way to get to the source . Everyone knew it couldn't be done until someone didn't know . Sometimes you have to change to stay yourself . Whoever wants to  whoever does not wants to  looks for a reason . Whoever has no defeat cannot be defeated . The summit is just the excuse for the ascent . Ideas are beautiful  but without implementation they remain ideas . It is not about the road you take  but the trail you leave . To make your dreams come true you have to wake up first . Complaining is pointless do something or forget . Not because it is difficult we do not dare  but because we do not dare it is difficult . Success goes from failure to failure without losing enthusiasm . Winners have a plan losers have an excuse . Worrying is fantasizing in the wrong direction . Success is not the end failure is not fatal it is the courage to carry on that counts . It is precisely the points where you do not meet the standard can show you what you are special at . You don't have to be good to be the best as long as you are better than the rest . Sometimes it is better to ask for forgiveness afterwards than for permission beforehand . Whoever goes his own way cannot be overtaken by anyone . If you think you are there  you are just not there . Those who never give up how close they were to their goal . If it does not go as it should then it should be as it goes . An accident is in a small corner  happiness is in the rest . You are not unhappy because of what you are going through  but you are unhappy because of the way you deal with it . The plural of guts is life . You can fall three times as long as you stand up four times . Have understanding for yourself and therefore also for someone else . Thoughts are like clouds . An apple cannot turn into a pear . The most powerful medicine for misery is to let go . You can not fail  unless you give up . People don't stumble over mountains only molehills . The person who says something cannot be done should not interrupt the person who is doing it . It is much more important to be interested than to be interesting . Life is like goose . You can start over again and again unless you get stuck . He who never errs never becomes wise . He who loses money a lot . He who loses a friend much more . He who loses it loses everything . Change in yourself what you think is wrong with others . Better imperfect and real than made perfect . Be satisfied with less and you will get more . Better to lay the first stone than to throw it . Pause for a moment . a lot of progress . A pessimist is an optimist who is misinformed . Better to regret what you did than what you did not . Before things get better  things get worse . The snail cruises the ark through persistence . Be yourself  there are already plenty of others . Doubt should not hesitate . My ambition is to die from exhaustion  not from boredom . Failure to prepare is to prepare for failure . The only place where success comes before work is the dictionary . I would love you little if I could say how much . If you can't keep someone out of your mind  it might be because that person should be there too . Love is just a word until you meet someone who gives it meaning . Love is the hardest";


