var ssx="Government is a measure to protect someone who cannot take good care of his money and property . The person whose property is under administration is called the person concerned . For example the person concerned is not only allowed to decide on his money car and home . Types of rule Full reign Everything the person holds is under administration . Limited reign Part of the property is under administration for example only the savings or the house . Temporary reign Reign over an agreed period . Natural Persons Debt Restructuring Act WSNP also gets the person with debts an administrator . However this is different from government . District Judge Paul Rouwen tells What it's like to be a trustee . And can the court help you with that . District Judge Paul Rouwen talks about it . Video player 0000 0316 Download this videoEarthing content is invisible click to read What does an administrator do . Among other things an administrator has the following tasks and obligations to make decisions about the money and property together with the person concerned or with the consent of the district court to pay money for the daily shopping of the tax return applications for surcharges or a benefit keeping records of the income and expenses his administration checked by the person concerned and the district judge The administrator does his job as much as possible in consultation with the person concerned . A person concerned may also have two administrators . Tasks and obligations for the non-professional administrator Administration receivership or mentorship There are 3 types of measures to protect someone . Curate is the toughest measure . Reign if someone can't take care of their money affairs . The district judge appoints an administrator who does this for him . Mentorship if someone cannot decide on personal non-financial matters such as care nursing treatment and counselling . The district judge appoints a mentor who makes the decisions for him . Curate if someone can't take care of their money and personal affairs . The district judge appoints a curator who does this for him . A person in receivership is incapacitated . This means for example that he cannot have custody of children . And he can't just decide to get married or make a will . It is possible to combine the measures regime and mentorship . Do you have a complaint about an administrator . Then you can write a letter to the district judge explaining your complaints . You send your letter to the court sector canton that oversees the regime . The judge will assess your complaints and may invite you both to a hearing . Types of administrator The non-professional administrator A relative of the person concerned spouse child or acquaintance . The professional administrator A person who is a trustee by profession and has to meet special quality requirements . This could also be a foundation . Publication of control in public registers Persons under administration can be found in The Central Receivership and Administration Register ccbr - if the person is wasting money or is in trouble due to debts . And sometimes when the administrator or the district judge finds registration necessary because of a person's mental or physical condition . the commercial register kvk . nl You leave Rechtspraak . nl . if the person concerned has a company the Land Registry land registry . nl You leave Rechtspraak . nl . if the person is involved in owning a property . Why registration in the CCBR . Publication in the register protects against entering into unwanted contracts . For example a company can check in the registry if someone is under administration . In this case the company will not conclude the contract until the administrator has the consent . Contact about administration The canton department or the administrative office of a court handles all matters of administration . Protection regime is a measure which a court may rule on behalf of an adult who by objective standards is unable to defend his own interests . Reasons may be the physical and/or mental state or the responsibility for accumulating debts due to addiction or other circumstances . ";


