	vv=wl[t];	
	if(vv==nextc){
		beg=t;
		w+=" "+nextc;
		//document.write(" xx"+sf[0]);		
	}
}

}


}
if(!(w=='' || w==' ')){
ddo=w.split(" ");
}

}
return w;
}


